import React from 'react';
import UpRight from './Upright';
const style = {
    width : "17rem"
}

function RightCard(props){
    return(
        <div className="col col-md-6 col-sm-12">
                <div className="row">      
                <UpRight key={props.index} heading={props.articles.title} imageUrl={props.item.urlToImage} para={props.item.content} />
                <UpRight key={props.index} heading={props.articles.title} imageUrl={props.item.urlToImage} para={props.item.content} />
                </div>
            </div>
    )
}
export default RightCard;
